import React from 'react';
 import { createContext, useState, useEffect} from 'react-dom';


 const Crypto = createContext();

const CryptoContext = ({children}) => {
    return(
        <Crypto.Provider>
            {children}
        </Crypto.Provider>
    )
}


export default CryptoContext;
